// Lambda style
NSNotificationCenter.DefaultCenter.AddObserver (
        QTMovie.ApertureModeDidChangeNotification, (notification) => {Console.WriteLine ("Received the notification QTMovie", notification); }


// Method style
void Callback (NSNotification notification)
{
    Console.WriteLine ("Received a notification QTMovie", notification);
}

void Setup ()
{
    NSNotificationCenter.DefaultCenter.AddObserver (QTMovie.ApertureModeDidChangeNotification, Callback);
}

